    false,nt"url": null,nt"notes": "This Light Detection and Ranging (LiDAR)
    LAS dataset is a topographic survey conducted for a coalition of GIS practitioners,
    including the Florida Division of Emergency Management (FDEM), Florida Water Management
    Districts, Florida Fish and Wildlife Conservation Commission, Florida Department
    of Environmental Protection, Army Corps of Engineers Jacksonville District, and
    other state and federal agencies. The goal for this project is to use the LiDAR
    data as new elevation inputs for updated SLOSH data grids. The ultimate result is
    the update of the Regional Hurricane Evacuation Studies (RHES) for the state. The
    State of Florida Division of Emergency Management LiDAR Survey was collected under
    the guidance of a Professional Mapper/Surveyor. Data were collected for 1019 square
    miles (includes the FDEM extent and the buy up area) within Brevard County, Florida
    from Sept 15, 2007 to Jan 16, 2008. This is a classified lidar data set. The data
    are classified: 1 = Unclassified, 2 = Ground (Bare Earth), 7 = Noise and 9 = Water.
    The FDEM Baseline Specifications required a maximum post spacing of 4 feet, however,
    the PDS (Program and Data Solutions) team required a much higher point density of
    its subcontractors in order to increase the probability of penetrating dense foliage
    during the mandated summer acquisition; with nominal post spacing of 0.7 meters
    per flight line and 50% sidelap between flight lines, the average point density
    is 4 points per square meter.",nt"license_title": null,nt"extras": [{ntt"key":
